#include <stdio.h>
#include <stdint.h>
#include<string.h>
#include <limits.h>
#define MAX 10000000


int compare(char a[], char b[]) {
  int l1, l2, p1, p2, n;


  if (a[0] == '-')
    p1 = 0;
  else
    p1 = 1;

  if (b[0] == '-')
    p2 = 0;
  else
    p2 = 1;



  l1 = strlen(a);
  l2 = strlen(b);


  if (p1 == 1 && p2 == 1) {
    if (l1 > l2)
      return 1;
    else if (l2 > l1)
      return 2;
    else {
      for (n = 0; n < l1; n++) {
        if (a[n] > b[n])
          return 1;
        if (b[n] > a[n])
          return 2;
      }
      if (n == l1)  
        return 0;
    }
  }


  if (p1 == 1 && p2 == 0) // 1st no positive
    return 1;
  if (p1 == 0 && p2 == 1) // 2nd no positive
    return 2;


  if (l1 < l2)
    return 1;
  if (l2 < l1)
    return 2;

  for (n = 1; n < l1; n++) {
    if (a[n] < b[n])
      return 1;
    if (b[n] < a[n])
      return 2;
  }

  return 0; 
}


